import React, { useState } from 'react'




const App = () => {

    const time = new Date().toLocaleTimeString();

    const state = useState();

    const [count, setCount] = useState(0);

    const IncNum = () => {
        setCount(count + 1);
    };




    return (
        <>

            <h1>{count}</h1>
            <button onClick={IncNum}>Click Me</button>
            <p>{time}</p>
        </>
    )
}

export default App
